import Header from '../components/header.js';
import Footer from '../components/footer.js';
import politicaimg from '../SURSE/logos/Untitled_logo_1_free-file.jpg';

function Politica(){
    return(
        <>
        <Header />
        <div className='w-full h-[400px] relative flex items-center justify-center pl-10 pr-10 '>
            <div className='bg-[#96ABAC] h-[300px] w-[950px] rounded-full relative flex items-center justify-center'>
            <h3 className='w-[225px] relative text-center'>Informațiile prezentate mai jos se referă la politica site-ului. </h3>
            <img src={politicaimg} className='rounded-full relative min-[640px]:scale-75 scale-50' />
            <h3 className='w-[225px] relative text-center'>Aceste politici sunt create pentru a asigura o experiență sigură și consistentă pentru utilizatori, respectând norme de utilizare corectă a conținutului și interacțiunilor din cadrul platformei.</h3>
            </div>
        </div>
        <Footer />
        </>
    );
}

export default Politica;
